using System;\nusing System.Collections.Generic;\n\npublic class FastStringLookup\n{\n    private HashSet<string> _stringSet;\n\n    public FastStringLookup(IEnumerable<string> strings)\n    {\n        // Initialize the HashSet with provided strings\n        _stringSet = new HashSet<string>(strings);\n    }\n\n    public bool Contains(string item)\n    {\n        return _stringSet.Contains(item);\n    }\n}\n\nclass Program\n{\n    static void Main()\n    {\n        var strings = new List<string> { "apple", "banana", "cherry" };\n        var lookup = new FastStringLookup(strings);\n\n        Console.WriteLine(lookup.Contains("banana")); // Output: True\n        Console.WriteLine(lookup.Contains("grape"));  // Output: False\n    }\n}